import Background from "../../../assets/wallpaper-4.jpg";

const MealItem = (props) => {
  const price = `${props.price.toFixed(2)} €`;

  return (
    <li>
      <div>
        <img
          src={Background}
          className="w-[300px] h-[150px] object-cover p-0 m-0 rounded-xl"
        />
        <div className="py-2 px-8">
          <h3 className="text-lg">{props.name}</h3>
          <div className="font-light texd-lg">{price}</div>
          <div className="font-thin">{props.description}</div>
        </div>
      </div>
      <div></div>
    </li>
  );
};

export default MealItem;
